import "./expense.css"

function Expense(props){
  
  return  (
    
         <div className="expense-item">
             <div >{props.title.toISOString()}</div>
           <div className='expense-item__description' >
               <h2 >{props.name}</h2>
           
           <div className="expense-item__price ">{props.amount}</div>
           </div>


    </div>  
)}

export default Expense;
